sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var payload = { 
    roleId: inputs.roleid,
    role: { 
        description: inputs.desc,
        title: inputs.title,
        stage: inputs.stage,
        includedPermissions: [ 
          inputs.permissions
         ]   
    }
  }
    outputs.payload = JSON.stringify(payload);  

})(inputs, outputs);

